INSERT INTO `articles` VALUES (2,'How Pestest Works','<table align=\"center\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td style=\"vertical-align:top\">\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><img alt=\"\" src=\"/uploads/courses_img/1.png\" style=\"border-style:solid; border-width:3px; height:210px; width:340px\" /></span></p>\n\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><img alt=\"\" src=\"/uploads/courses_img/2.png\" style=\"border-style:solid; border-width:3px; height:210px; line-height:20.8px; width:340px\" /></span></p>\n\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><img alt=\"\" src=\"/uploads/courses_img/3.png\" style=\"border-style:solid; border-width:3px; height:210px; line-height:20.8px; width:340px\" /></span></p>\n			</td>\n			<td style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\">            </span></td>\n			<td style=\"vertical-align:top\">\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:28px\"><strong>Pestest is a one-stop-shop for all of your continued education needs.</strong></span></span></p>\n\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:18px\">Browse through Pestest&#39;s wide selection of comprehensive e-courses and practice tests to meet your continued education needs.</span></span></p>\n\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:18px\">Our immersive <strong>e-courses </strong>cover a wide ranging variety of topics, complete with video lessons divided into chapters and accompanied with quizzes to ensure that you are fully comfortable with the materials before moving on to the next topic. Completing qualifying e-courses issues electronic copies of completion certificates, so you can meet your continued education hour requirements.</span></span></p>\n\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\">​<span style=\"font-size:18px\">If you simply want to prepare for an upcoming license test, simply purchase <strong>practice tests</strong> to quiz yourself on the topic. The practice tests feature questions very similar to those found on the state exams, and would present a quick and easy way for you to get yourself familiarized with what to expect on the exams.</span></span></p>\n\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:18px\">Simply register an account to browse through our selection of e-courses and practice tests.</span></span></p>\n			</td>\n		</tr>\n	</tbody>\n</table>',1),(6,'Terms','<br />\n<span style=\"font-size:14px\">Terms of Service<br />\nPestest.com, A&amp;K Computers, Inc.</span><br />\n<br />\n<span style=\"font-size:14px\"><em>This agreement was last modified on 18 Mar, 2014.</em></span>\n<div style=\"text-align: justify;\"><br />\n<span style=\"font-size:14px\">These terms of service document the legally binding terms and conditions attached to the use of the site, Pestest.com.<br />\nBy using or accessing the site in any way, viewing or browsing the site, or adding your own content to the site, you are agreeing to be bound by these Terms of Service.<br />\n<br />\n<strong>Intellectual Property</strong><br />\nThe site and all of its original content are the sole property of Pestest.com and are, as such, fully protected by the appropriate international copyright and other intellectual property rights laws.<br />\n<br />\n<strong>Termination</strong><br />\nPestest.com reserves the right to terminate your access to the site, without any advance notice.<br />\n<br />\n<strong>Links to Other Websites</strong><br />\nOur site may contain a number of links to other websites and online resources that are not owned or controlled by Pestest.com.<br />\nPestest.com has no control over, and therefore cannot assume responsibility for, the content or general practices of any of these third party sites and/or services. Therefore, we strongly advise you to read the entire terms and conditions and privacy policy of any site that you visit as a result of following a link that is posted on our site.<br />\n<br />\n<strong>Governing Law</strong><br />\nThis agreement is governed in accordance with the laws of California, United States.<br />\n<br />\n<strong>Changes to This Agreement</strong><br />\nPestest.com reserves the right to modify these Terms of Service at any time. We do so by posting and drawing attention to the updated terms on the site. Your decision to continue to visit and make use of the site after such changes have been made constitutes your formal acceptance of the new Terms of Service.<br />\nTherefore, we ask that you check and review this agreement for such changes on an occasional basis. Should you not agree to any provision of this agreement or any changes we make to this agreement, we ask and advise that you do not use or continue to access Pestest.com immediately.<br />\n<br />\n<strong>Contact Us</strong><br />\nIf you have any questions about this agreement, please feel free to contact us at info@pestest.com.</span></div>\n<br />\n ',1),(3,'Pricing','Pricing',0);
