pany','EMAIL_TESTING_COMPANY','<p>Dear #company#,</p>\n\n<p>Your student, #name#, has successfully completed #test# (#code#) on #date#.<br />\n<br />\nYour student has scored #score# points, and finished the test in #duration#.</p>\n\n<p>#site#</p>','',0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','',''),(12,1,'Checkcode User','EMAIL_CHECKCODE_USER','<p>Date: #date#</p>\r\n<p>User Name: #username#</p>\r\n<p>Test: #test#</p>\r\n#description#','',0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','',''),(13,1,'Email Payment','EMAIL_PAYMENT','<p>Date: #date#</p>\r\n<p>Full Name: #username#</p>\r\n<p>Test: #test#</p>\r\n<p>Transaction Code: #ordercode#</p>','',0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','',''),(14,1,'Email Skip Payment','EMAIL_SKIPPAYMENT','<p>Date: #date#</p>\r\n<p>Full Name: #username#</p>\r\n<p>Test: #test#</p>','',0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','','');
