at is the most common ant occurring in and around structures?',4,1371032383,'','','','Active'),(603,5,0,'Is it physically possible for pigs to look up into the sky?',1,1357998993,'It is physically impossible for pigs to look up in the sky – they can\\\'t roll down to see the sky, but not in the standing position. Although their anatomy of the neck muscles won’t let them look totally upwards. The only way left to see the sky (or only its reflection) is to look in the mud.','','','Active'),(604,5,0,'A crocodile can\'t stick its tongue out?',1,1357999154,'Crocodiles are not able to stick their tongue out. It is attached to the bottom of the mouth by a membrane, so it can raise up to press food to the top of the mouth, but cannot move outside the mouth.','','','Active'),(605,5,0,'Where do you think shrimp\'s heart is located?',1,1357999146,'The heart of a shrimp is found in its head because its heart is found in the Cephalothorax. In various arthropods, some of the body parts are fused together and function as one part. In the case of Cephalothorax, it is the head and the thorax fused as one and this is where the shrimp\'s heart is located.','','','Active'),(606,5,0,'Like fingerprints, everyone\'s tongue print is different.',1,1357999139,'As well as being one of the strongest muscles in the human body, the tongue has another interesting quality. Just like unique finger prints, humans also possess a unique tongue print.','','','Active'),(607,5,0,'What country has the largest population?',1,1357999131,'With more than 1.3 billion people, China is the world\\\'s most populous country. As the world\\\'s population is approximately 6.7 billion, China represents a full 20% of the world\\\'s population, so one in every five people on the planet is a resident of China.','','','Active'),(608,5,0,'Sloths take two weeks to digest their food.',1,1357999121,'In fact, they actually only defecate once every 8 days! Sloths rely on bacteria in their stomachs to digest their food. Also, their rate of digestion is dependent on the temperature. If it\\\'s night time, or they\\\'re in the shade, their digestion rate slows.','','','Active'),(609,5,0,'How many continents are there on the Earth?',1,1357999112,'In the most widely accepted view, there are 7 continents in the world: Asia, Africa, Europe, North America, South America, Antarctica, and Australia(Oceania).','','','Active'),(610,5,0,'Butterflies taste with their feet.',1,1357999103,'Taste receptors on a butterfly\\\'s feet help it find its host plant and locate food. Many can also taste with their proboscis — an elongated part of the mouth — but the feet are the primary means of taste. Butterflies\\\' feet allow to taste a flower as soon as they land on it.','','','Active'),(611,5,0,'Dolphins sleep with one eye open',1,1357999096,'Dolphins sleep only with one half of their brain at a time. Dolphins are conscious breathers. Should they sleep and go unconscious as we do they would simply suffocate or drown. Sleeping dolphins can be seen as resting, floating at the surface, with one eye open. After a time, they will close the one eye and open the other one. They alternate like this throughout their entire nap.','','','Active'),(612,5,0,'The longest recorded flight of a chicken is 13 seconds',1,1357999084,'According to several chicken trivia sites including Guinness World Book the longest verified flight of a domestic chicken is 13 seconds and 301.5 feet distance.','','','Active'),(613,5,0,'Women blink nearly twice as much as men',1,1357999076,'Women blink more often than men essentially because of the higher levels of Estrogen in their systems. Estrogen as a hormone stimulates the production of lubricants throughout the body, including the eye.','','','Active'),(614,5,0,'Your heart beats over 100,000 times a day',1,1357999069,'An average heart beats 100,000 times a day, pumping some 2,000 gallons of blood through its chambers to the rest of the body and then back to the heart. Over a 70-year life span, that adds up to more than 2.5 billion heartbeats.','','','Active'),(615,5,0,'You can\'t kill yourself by holding your breath',1,1357999057,'Its impossible to commit suicide by holding your breath because when holding your breath eventually you have a reflex of a deep exhalation to get stagnant gasses out of your lungs such as carbon monoxide and nitrogen. Even if you can force yourself to overcome this reflex you would eventually pass out from lack of oxygen to your brain. After passing out you would begin breathing as normal and after a few seconds or minutes wake up again.','','','Active'),(616,5,0,'Beetles taste like apples, wasps like pine nuts, and worms like fried bacon',1,1357999051,'On the whole, insects tend to taste a bit nutty, especially when roasted. This comes from the natural fats they contain, combined with the crunchiness of their mineral-rich exoskeletons.','','','Active'),(617,5,0,'Astronauts are not allowed to eat beans before they go into space because passing wind in a space suit damages them',1,1357999044,'Edwin Murphy suggested that the ideal astronaut should be totally flatus-free at a 1964 Conference on Nutrition in Space and Related Waste Problems. But instead of looking for low-emission astronauts, NASA banned flatulence-inducing foods like beans, cabbage, sprouts and broccoli.','','','Active'),(618,5,0,'Who invented scissors?',1,1357999028,'It is believed that the famous artist Leonardo Da Vinci invented the scissors, which many people use every day. Earlier versions of scissors can be traced back to the Egyptians.','','','Active'),(619,5,0,'How many planets are in the solar system?',1,1357999023,'According to the International Astronomical Union\\\'s definition for a planet, there are 8 known planets in the Solar System: Mercury, Venus, Earth, Mars, Jupiter, Saturn, Uranus, and Neptune.','','','Active'),(620,5,0,'What is the name of the largest ocean on earth?',1,1357999016,'The Pacific Ocean is the largest of the world’s five oceans, followed by the Atlantic Ocean, Indian Ocean, Southern Ocean, and Arctic Ocean. It covers an area of about 155 million square kilometers (about 60 million square miles). It is larger than the total land area of the world and about 15 times the size of the United States.','','','Active'),(621,5,0,'What is hotter, the center of the earth or surface of the sun?',1,1357999008,'A team of scientists have now made the most accurate measurement of Earth\\\'s core temperature to date and their results show that it\\\'s over 1,000 degrees hotter than they previously thought. It\\\'s even hotter than the surface of the Sun. They now believe the temperature to be around 6,000 °C plus or minus 500 degrees.','','','Active'),(622,5,0,'What is the fastest land mammal in the world?',1,1357999001,'The cheetah is the fastest land mammal on Earth, capable of running 64 miles per hour. However, this cat cannot sustain high speeds for long. Cheetahs typically run in short bursts covering distances of up to 500 yards. Most chases last less than one minute, so the cheetah must quickly catch its prey before it escapes.','','','Active'),(623,5,0,'What is the hottest planet in the solar system?',1,1357998984,'At a scorching 480° C (896° F) Venus is the hottest planet in the solar system. It has a dense atmosphere made up of mostly carbon dioxide which is a greenhouse gas. Greenhouse gases trap the sun\\\'s heat.','','','Active'),(624,5,0,'What planet is famous for its big red spot on it?',1,1357998977,'The Great Red Spot on Jupiter was first discovered by Giovanni Domenico Cassini, with a telescope in 1665. It is an anticyclonic storm, similar to a hurricane, which has been raging on the planet for a long time.','','','Active'),(630,5,0,'What is the chemical symbol for gold?',1,1357998955,'Gold is a chemical element with the atomic number 79 and chemically denoted as Au. Its chemical symbol is derived from the Latin name Aurum which means gold. It is soft, malleable, dense and shiny. It is yellow in colour when found in its pure form.','','','Active'),(631,5,0,'Can frogs live in salt water?',1,1357999243,'In order to live in salt water, frogs would have to be able to either get freshwater from organisms they eat, as whales do, or be able to drink saltwater and eliminate the salt, via gills, as fish do, or via the nasal cavity as seabirds do. They do not have any of these adaptations.','','','Active'),(632,5,0,'What is the name of the process by which plants convert sunlight into food?',1,1357999353,'Photosynthesis is the process by which plants, algae, and some bacteria generate food from light. The process begins when sunlight is absorbed by specific proteins containing chlorophyll. The food itself comes from carbon dioxide, but the sunlight provides the energy needed to create certain necessary chemical reactions. The carbon dioxide is broken down into a type of sugar and oxygen is emitted as a waste product.','','','Active'),(633,5,0,'Who was the first person to walk on the moon?',1,1357999494,'In 1969 Neil Armstrong became the very first man to walk on the Moon. The astronaut stepped onto the Moon\\\'s surface, in the Sea of Tranquility, nearly 20 minutes after first opening the hatch on the Eagle landing craft.','','','Active'),(634,5,0,'How many legs does a spider have?',1,1357999527,'All arachnids are the spider species and they have 8 legs. They use their legs to get around and climb up walls. This is their uniqueness which separate them from insects. Most insects have only six legs and possibly a set of pincers.','','','Active'),(635,5,0,'How many pairs of wings does a bee have?',1,1357999579,'Bees have four wings. There are two on each side. A honey bee can fly up to 15mph and the wings beat at almost 200 times a second. That\\\'s 12,000 beats a minute.','','','Active'),(636,5,0,'Do male or female mosquitoes bite people?',1,1358003535,'Only the female mosquitoes bite humans because they need the blood for their eggs. Human blood contains protein, and the female mosquito needs the protein to develop its eggs. The male doesnt have the probiscus to bite you, it feeds on flower nectar.','','','Active'),(637,5,0,'Is the domestic dog a carnivore, omnivore or herbivore?',1,1360660806,'By nature dogs are carnivores. Because of their domestication, by us, they are capable of eating certain fruits and vegetables, but they should make up only a small percentage of their diets.','','','Active'),(638,5,0,'What is a dog\'s most powerful sensory organ?',1,1363075231,'A dog’s sense of smell is its primary way of making sense of the world. The lining inside a dog’s snout is covered with scent receptors. The amount of receptors varies according to breed. A dachshund has around 125 million, while a beagle has almost twice that amount. People, by comparison, have a mere five to six million. So it’s no wonder that a dog’s sense of smell is much sharper than humans.','','','Active'),(769,5,0,'Who is the Hubble Space Telescope named after?',1,1384250730,'Hubble Space Telescope was named after the famous scientist Edwin P. Hubble (1889-1953) because he was the one who made the discovery that our universe was expanding. The telescope orbits the earth in a position just above its atmosphere. This position enables the telescope to get unique views of the universe without any distortion unlike any telescope on the ground.','','','Active'),(770,5,0,'What scientist is well known for his theory of relativity?',1,1384250801,'Albert Einstein formulated The Theory of Relativity. It explained a lot of how time and distance may change due to the \\\"relative\\\" or different speed of the object and the observer.','','','Active'),(771,5,0,'What does CPU stand for in computer terminology?',1,1384250877,'CPU stands for Central Processing Unit and gets its name from the fact that it is the microprocessing chip at the very heart of your computer. It is involved in all the important processing of data, interpreting the instructions from software and hardware and controlling every device contained within your computer.','','','Active'),(772,5,0,'What is the Earth\'s primary source of energy?',1,1384250934,'The primary source of energy for nearly Earth\'s entire Ecosystem is the sun. The sunlight has a direct effect on all ecosystems. This is especially true for the growth of plants using photosynthesis.','','','Active'),(773,5,0,'What state was Britney Spears born in?',1,1384250992,'The American recording artist and entertainer Britney Spears was born in McComb, Mississippi and raised in Kentwood, Louisiana. Now she lives in Los Angeles, California. Her home is worth approximately $18.9 million and is situated on an estate in the Hidden Hills.','','','Active'),(774,5,0,'What is the name of Christina Aguilera\'s son?',1,1384251043,'Christina Aguilera\'s son is named Max Liron Bratman, who was born on Jan. 12, 2008. She explained that the word \"Liron\" means \"My Song\" in Hebrew. \"Max\" means \"the greatest.\" Hence, Max Liron is Christina\'s greatest song.','','','Active'),(775,5,0,'Which of the following is NOT one of the Real Housewives of New Jersey?',1,1384251109,'The Real Housewives of New Jersey chronicles the lives of five women in and around several communities in northern New Jersey. The current cast is composed of: Teresa Giudice, Jacqueline Laurita, Caroline Manzo, Melissa Gorga and Kathy Wakile.','','','Active'),(776,5,0,'Who won the 2013 Miss U.S.A pageant?',1,0,'Erin Brady from Connecticut took the title of Miss USA 2013. She works as a financial accountant and earned a finance degree at Central Connecticut State University, where she minored in criminal justice. Brady, who struggled with alcoholism in her family, has said she intends to become an advocate for children of addicts.','','','Active'),(777,5,0,'What country did the rice dish \"paella\" come from?',1,1386881487,'Paella originated close to Lake Albufera in a lagoon in Valencia in the mid 19th Century. It is a Valencian rice dish that came from the east coast of Spain and is viewed by Spaniards as the national dish. The different types of paella include mixed paella, Valencian paella and seafood paella.','','','Active'),(944,5,0,'McDonald\\\'s has restaurants in over 100 countries around the world.',1,0,'McDonald\\\'s has more than 30,000 local restaurants serving 52 million people in more than 100 countries each day. With the steady demand in fast food restaurants, you can expect this numbers to rise.','','','Active'),(945,5,0,'Cooking food often transforms its chemical make up',1,0,'It is a chemical change because you are changing the atoms,molecules and everything that was the original form of the substance. You can also tell by the fact that it looks different and smells different.','','','Active'),(946,5,0,'Which of the following is a judge on the show \"X Factor\"?',1,0,'In May 2012, Demi Lovato was hired as a judge for the second season of the American version of The X Factor with a reported salary of $1 million, joining fellow new judge Britney Spears and returning judges Simon Cowell and L.A. Reid. Her hire was speculated to be in hopes of luring a younger audience.','','','Active'),(947,5,0,'How many times a year does Victoria\'s Secret hold sales?',1,0,'Victoria\'s Secret hold sales twice a year. The start date for Victoria\'s Secret semi-annual sale is different each year. It is usually issued by the official site.','','','Active'),(948,5,0,'Who is Prince William, the Duke of Cambridge, married to?',1,0,'Prince William is married to Kate Middleton, the Duchess of Cambridge. The wedding took place on 29 April 2011 at Westminster Abbey in London. The build-up to the wedding and the occasion itself attracted much media attention, being compared in many ways with the 1981 marriage of William\\\'s parents.','','','Active'),(949,5,0,'What did Martha Stewart go to jail for?',1,0,'The offense leveled against Martha Stewart was one of \\\"insider trading,” wherein an individual buys or sells stocks by using non-public information given to them by the people of a company. Insider trading is not legal and is considered a serious offense.','','','Active'),(950,5,0,'What type of sweet bell pepper has the highest amount of vitamin C?',1,0,'Sweet bell peppers contain plenty of vitamin C, which powers up your immune system and keeps skin youthful. Red peppers are more mature than green, orange or yellow bell peppers. They are rich in carotenoid phytonutrients and contain almost eleven times more beta-carotene than green bell peppers as well as one and a half times more vitamin C.','','','Active'),(951,5,0,'What country experiences the most tornadoes?',1,0,'The United States has the most tornadoes of any country, and most strong and violent tornadoes. This is because the United States has an abundance of flat, low-lying geographic regions, and it also has a climate that is conducive to intense thunderstorms, and tornadoes tend to form during thunderstorms.','','','Active'),(952,5,0,'Like fingerprints, everyone\'s tongue print is different.',1,0,'As well as being one of the strongest muscles in the human body, the tongue has another interesting quality. Just like unique finger prints, humans also possess a unique tongue print.','','','Active'),(953,5,0,'Who was elected the vice president of the United States in 2009?',1,0,'Joseph Biden became vice president of the United States in 2009, after having been a U.S. senator from Delaware since 1973. He is the 47th Vice President of the United States, jointly elected with President Barack Obama.','','','Active'),(954,5,0,'What is the first element on the periodic table?',1,0,'Hydrogen is the first element in the periodic table, meaning it has an atomic number of 1 or 1 proton in each hydrogen atom. It is the most abundant element. About 75% of the element mass of the universe is hydrogen.','','','Active'),(955,5,0,'Over a long period of time while under extreme heat and pressure, graphite turns into which precious mineral?',1,0,'Graphite and diamonds share a common characteristic. They are both pure carbon. What distinguishes the two is their molecular makeup. Graphite is composed of layers of molecules, whereas diamonds are cubic in nature. When subjected to high temperatures and incredible pressure, graphite molecules are forced to re-align and form a cubic formation known as crystal, and a diamond is born.','','','Active'),(956,5,0,'When did the Apple iPhone first become available?',1,0,'Initially priced at US $599 and US $499 for the 8GB and 4GB models, the iPhone went on sale on June 29, 2007. Apple closed its stores at 2:00pm local time to prepare for the 6:00pm iPhone launch, while hundreds of customers lined up at stores nationwide.','','','Active'),(957,5,0,'Dogs have better eyesight than humans on average.',1,0,'Dog\\\'s eyes are better equipped to deal with the dark, enabling them to see better than humans. Also, dogs have better peripheral vision, which allows them to see further to the sides than we can. So, not only can they hear someone approaching from behind sooner, they can also see them sooner as well.','','','Active'),(958,5,0,'What do Firefox, Opera, Chrome, Safari and Explorer refer to?',1,0,'Firefox, Opera, Chrome, Safari and Explorer are all types of web browsers. They retrieve, present and traverse information resources on the World Wide Web. They can also be used to access information provided by web servers in private networks or files in file systems.','','','Active'),(959,5,0,'What did Kim Kardashian name her baby?',1,0,'Kim Kardashian and Kanye West named their baby daughter North West. They said North is the highest power, so naming her North is the highest point between the two of them. The couple have already given their daughter a nickname - she will be \\\'Nori for short\\\'.','','','Active'),(960,5,0,'Honeybees have hair on their eyes. True or False?',1,0,'Bees are responsible for travelling from flower to flower transferring pollen. The pollen is able to transfer with the bee because of all the tiny hairs on the bees body, which pollen gets stuck in. Bees have tiny hairs on their eyes in order to transfer more pollen with every visit.','','','Active'),(961,5,0,'Penguins can jump as high as 10 feet in the air. True or False?',1,0,'Penguins can jump as high as 6 or 7 feet in the air by rocketing straight out of the water onto the land. But this is a little deceptive, since they don\'t actually jump this high from land - their feet are made for swimming, not the high jump.','','','Active'),(962,3,37,'The term “zoonosis” means:',1,1417540990,'','','','Active'),(963,3,37,'Which of the following is a common carrier of Hantavirus:',1,1417540974,'','','','Active'),(964,3,37,'When rats move they prefer to:',1,1417541073,'','','','Active'),(965,3,37,'After birth the Brown or Norway rat becomes sexually mature within:',1,1417541141,'','','','Active'),(966,3,36,'Rodents which are considered pests are called:',1,0,'','','','Active'),(967,3,36,'Rats are “omnivorous” which means:',1,1417541323,'','','','Active'),(968,3,36,'After birth the Brown or Norway rat becomes sexually mature within:',1,1417541388,'','','','Active'),(970,3,36,'After birth the Roof rat my reach sexual maturity within:',1,1417541584,'','','','Active'),(971,3,36,'Which of the following rat has the longest tail in relation to their body:',1,1417541655,'','','','Active'),(972,3,36,'The tail of the Norway rat is:',1,1417541716,'','','','Active'),(973,3,36,'The tail of the Roof rat is:',1,0,'','','','Active'),(974,3,36,'The droppings of Norway rats are:',1,0,'','','','Active'),(975,3,36,'Which of the following features distinguishes Roof rats from Norway rats? ',1,0,'','','','Active'),(976,3,36,'Deer mice are distinguished from house mice by a,',1,1417542292,'','','','Active'),(977,3,40,'Mice are known to jump vertically up to a distance of:',1,1417542354,'','','','Active'),(978,3,40,'Which of the following is the weakest in both mice and rats:',