INSERT INTO `site` VALUES (1,'PestSchool.com','440 N Wolfe Rd','Sunnyvale','CA','94085','1447734410_pestschool_logo.png',340,340,'1-408-244-4811','','Pass your state exam.','wthanhbinh@gmail.com','PesTesT','Pest Control License Test preparation, Pre test','',20,20,5,5,'m/d/Y','F j, Y, g:i a','0','styleSIC',1,1,1,0,0,1,'<table align=\"center\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td>\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><img alt=\"\" src=\"/uploads/courses_img/1.png\" style=\"border-style:solid; border-width:3px; height:210px; width:340px\" /></span></p>\n\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><img alt=\"\" src=\"/uploads/courses_img/2.png\" style=\"border-style:solid; border-width:3px; height:210px; line-height:20.8px; width:340px\" /></span></p>\n\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><img alt=\"\" src=\"/uploads/courses_img/3.png\" style=\"border-style:solid; border-width:3px; height:210px; line-height:20.8px; width:340px\" /></span></p>\n			</td>\n			<td style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\">            </span></td>\n			<td>\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:28px\"><strong>Pestest is a one-stop-shop for all of your continued education needs.</strong></span></span></p>\n\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:18px\">Browse through Pestest&#39;s wide selection of comprehensive e-courses and practice tests to meet your continued education needs.</span></span></p>\n\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:18px\">Our immersive <strong>e-courses </strong>cover a wide ranging variety of topics, complete with video lessons divided into chapters and accompanied with quizzes to ensure that you are fully comfortable with the materials before moving on to the next topic. Completing qualifying e-courses issues electronic copies of completion certificates, so you can meet your continued education hour requirements.</span></span></p>\n\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\">​<span style=\"font-size:18px\">If you simply want to prepare for an upcoming license test, simply purchase <strong>practice tests</strong> to quiz yourself on the topic. The practice tests feature questions very similar to those found on the state exams, and would present a quick and easy way for you to get yourself familiarized with what to expect on the exams.</span></span></p>\n\n			<p style=\"text-align:justify\"><span style=\"font-family:verdana,geneva,sans-serif\"><span style=\"font-size:18px\">Simply register an account to browse through our selection of e-courses and practice tests.</span></span></p>\n\n			<p style=\"text-align:justify\"> </p>\n\n			<p style=\"text-align:justify\"> </p>\n\n			<p style=\"text-align:justify\"> </p>\n\n			<p style=\"text-align:justify\"> </p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n','<h3 style=\"text-align:center\">Immersive classroom on the web.</h3>\n\n<h3 style=\"text-align:center\">Meet your continued education needs here.</h3>\n');
/*!40000 ALTER TABLE `site` ENABLE KEYS */;
UNLOCK TABLES;

